const Header=(props)=>(
  <>
  <h1>{props.course}</h1>
  </>
)
const Parts=(props)=>(
  <>
   <p>
    {props.parts.name} {props.parts.exercises}
    </p>
  </>
)
const Content=(props)=>(
      <>

      <Parts parts={props.part1}/>
      <Parts parts={props.part2}/>
      <Parts parts={props.part3}/>
  </>
)
const Total=(p)=>(
  <p>Number of exercises {p.ex1+p.ex2+p.ex3}</p>
)

const App=()=>{
  const course='Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return(
    <div>
      <Header 
      course={course}
      />
      <Content part1={part1}
      part2={part2}
      part3={part3}
      />
      <Total
      ex1={part1.exercises}
      ex2={part2.exercises}
      ex3={part3.exercises}
      />
    </div>
  )
}
export default App
